$(function () {
    // 百度统计
    // baidu_track_name='a' （标签名称）
    // baidu_track_action='click'（触发事件，如：click）
    // baidu_track_label='一辆安全的保姆车' （标签内容）
    // baidu_track_val='53805'（页面文章ID）

    // 获取url？后面的参数
    function GetRequest() {
        var url = location.search; //获取url中"?"符后的字串
        var theRequest = new Object();
        if (url.indexOf("?") != -1) {
            var str = url.substr(1);
            strs = str.split("&");
            for (var i = 0; i < strs.length; i++) {
                theRequest[strs[i].split("=")[0]] = unescape(strs[i].split("=")[1]);
            }
        }
        return theRequest;
    }

    // 获取物料id
    var MaterialID1 = (window.location+'').split('/')[(window.location+'').split('/').length-1].split('.')[0];
    var utm_term=GetRequest().utm_term;
    var suiji=utm_term?utm_term:MaterialID1;
    /**
     * Written by:      zhengxh
     * function:        jq仿rem适配
     * Created Date:    2018-01-06
     */
    function setImgSize() {
        var originWidth = 375,
            ratio = $(window).width() / originWidth;
        $('.img-size').each(function () {
            var self = $(this);
            $.each(['height', 'width', 'left', 'fontSize', 'right', 'bottom', 'top', 'paddingTop', 'lineHeight', 'paddingLeft', 'paddingRight', 'paddingBottom', 'marginTop', 'marginLeft', 'marginRight', 'marginBottom','padding','borderRadius'], function (i, str) {
                var num = self.attr('data-' + str);
                if (num) {
                    num = num * ratio / 2 + 'px';
                    self.css(str, num)
                }
            })
        });
    }
    function is_weixn() {
        var ua = navigator.userAgent.toLowerCase();
        if (ua.match(/MicroMessenger/i) == "micromessenger") {
            return true;
        } else {
            return false;
        }
    }

    if(document.referrer.split('/')[document.referrer.split('/').length-1]=='make_money.html'||document.referrer.split('/')[document.referrer.split('/').length - 1] .indexOf('OrderDetails.html')!=-1){
        $('.M_footer').html('<a baidu_track_name="a" baidu_track_action="click" baidu_track_label="立即分享" baidu_track_val="'+MaterialID1+'" track="'+suiji+'" id="GuideSharing" style="line-height: 45px;text-align: center;display: block;width: 100%;height: 100%;background: url(data:image/png;base64,)">\n' +
            '            <b class="img-size" data-fontSize="30" data-paddingLeft="45" style="font-weight: 100;color: #fff;background: url(data:image/png;base64,) no-repeat left center;background-size: contain">立即分享</b>\n' +
            '        </a>')
    }else if(is_weixn()){
        $('.M_footer').html('<a baidu_track_name="a" baidu_track_action="click" baidu_track_label="立即赚钱" baidu_track_val="'+MaterialID1+'"  track="'+suiji+'" href="http://wxs.chitunion.com/moneyManager/make_money.html"><img style="width:100%" src="data:image/png;base64,"></a>')
    }else {
        $('.M_footer').html('<div>\n' +
            '    </div>\n' +
            '    <span>\n' +
            '        </span>\n' +
            '    <p>\n' +
            '        <button><a baidu_track_name="a" baidu_track_action="click" baidu_track_label="询底价" baidu_track_val="'+MaterialID1+'"  track="'+suiji+'" href="https://h5.qichedaquan.com/jike/?jkcx=0" style="color:white">询底价</a></button>\n' +
            '    </p>')
    }

    setImgSize()

    $('#GuideSharing').on('click',function () {
        $('.GuideSharing_Mask_img').show().off('click').on('click',function () {
            $('.GuideSharing_Mask').click()
        })
        $('.GuideSharing_Mask').css({position:'fixed',left:0,top:0,width:'100%',height:'100%',backgroundColor:'rgba(0,0,0,.7)',zIndex:99}).show().off('click').on('click',function () {
            $(this).hide()
            $('.GuideSharing_Mask_img').hide()
        })
    })
})